import React from 'react';

// third-party
import {FormattedMessage} from 'react-intl';

// assets
import {IconBrandChrome} from '@tabler/icons';

import menuData from './json/menu-items.json';

// constant
const icons = {IconBrandChrome};

// ===========================|| SAMPLE PAGE & DOCUMENTATION MENU ITEMS ||=========================== //
const makeMenuItems = menuItem => {
    const menuItemChildren = menuItem.children.map(menuChildren => ({
            "id": menuChildren.id,
            "title": <FormattedMessage id={menuChildren.title} />,
            "type": menuChildren.type,
            "url": menuChildren.url,
            "icon": icons.IconBrandChrome,
            "breadcrumbs": menuChildren.breadcrumbs,
        }))
    return {
        id: menuItem.id,
        type: menuItem.type,
        children: [...menuItemChildren]
    }
}


const userTypeMenuData = menuData['case-manager']
const preparedMenuItems = userTypeMenuData.map(makeMenuItems)

// const preparedMenuItems = [
//     {
//         id: 'sample-docs-roadmap',
//         type: 'group',
//         children: [
//             {
//                 id: 'client-assessment',
//                 title: <FormattedMessage id="client-assessment" />,
//                 type: 'item',
//                 url: '/client-assessment',
//                 icon: icons.IconBrandChrome,
//                 breadcrumbs: true
//             }
//         ]
//     }
// ];

export default preparedMenuItems;
